import React from 'react';
import ServiceCard from './ServiceCard';
import './ServiceOverview.css';

const ServiceOverview = () => {
  return (
    <section className="service-overview">
      <div className="services-grid">
        <ServiceCard
          title="Custom Web Development"
          description="We build responsive, scalable websites tailored to your business needs."
          metric="500+ Projects Delivered"
          delay="100"
          serviceType="Custom Web Development"
        />
        <ServiceCard
          title="SaaS Solutions"
          description="Our SaaS solutions help streamline your business operations."
          metric="100+ SaaS Applications Launched"
          delay="200"
          serviceType="SaaS Solutions"
        />
        <ServiceCard
          title="E-Commerce Development"
          description="Create powerful online stores with our e-commerce development services."
          metric="250+ E-Commerce Sites Built"
          delay="300"
          serviceType="E-Commerce Development"
        />
      </div>
    </section>
  );
};

export default ServiceOverview;
